import React, { useState, useRef } from 'react';
import { IonContent, IonHeader, IonPage, IonToolbar, IonButton, IonSlides,IonSlide,IonButtons,IonIcon,useIonViewWillEnter, IonImg, IonTitle, IonText } from '@ionic/react';
import { arrowForward } from 'ionicons/icons';
import './Homepage.scss';
import { RouteComponentProps, withRouter } from 'react-router';
import { IonReactRouter } from '@ionic/react-router';
import { Link } from 'react-router-dom';
import { useHistory } from "react-router-dom";
import history from '../history';
import UserService from "../services/UserService";
import { BookmarkSharp } from 'react-ionicons'

type SomeComponentProps = RouteComponentProps;
const Homepage: React.FC<SomeComponentProps> = ({ history }) => {

    return (
        <IonPage id="home-page">
          <IonContent fullscreen>
          <div className="contain_1">
                <IonImg src="/assets/img/ifcm_logo.png" className="logo" alt="Logo_IFCM"></IonImg>
                <h1 className="titre_contain1">Good Morning Raoul,</h1>
             </div>
             
             <div className="contain_2">
               <h2 className="contain_2_text">
                 Worries destroy the heart. Please 
                    guard your heart. 
                   
                    </h2>
                    <p  className="contain_2_prophetie">Prophet Philip Banda     </p>
             </div>
             <div className="contain_3">
                <h3 className="contain_3_titre"> Verse of the day</h3>
                <IonText className="contain_3_verse">
                  <BookmarkSharp 
                 color={'#0279dc'}
                 />John 14:12</IonText><br/>
                <IonText className="contain_3_text" >« Doing the work of Jesus Christ. »</IonText>
             </div>

             <div className="contain_4">
               <h4 className="contain_4_titre">Upcomming events</h4>
             </div>
          </IonContent>
        </IonPage>
        
  );
}
export default withRouter (Homepage);
